function extensioncheck() {
  if (
    localStorage.getItem("deg") === null &&
    localStorage.getItem("text") === null &&
    localStorage.getItem("logourl") === null &&
    localStorage.getItem("flagurl") === null
  )
    return;
  document
    .getElementById("html")
    .setAttribute(
      "style",
      "background:linear-gradient(" +
        localStorage.getItem("deg") +
        "," +
        localStorage.getItem("grad1") +
        "," +
        localStorage.getItem("grad2") +
        ");"
    );
  for (let i = 0; i < document.getElementsByClassName("textbox").length; i++) {
    document
      .getElementsByClassName("textbox")
      [i].setAttribute("style", "color:" + localStorage.getItem("text") + ";");
  }
  document
    .getElementById("img1")
    .setAttribute("src", localStorage.getItem("logourl"));
  document
    .getElementById("progflag")
    .setAttribute("src", localStorage.getItem("flagurl"));
  document
    .getElementById("incount")
    .setAttribute("value", localStorage.getItem("countval"));
  document
    .getElementById("help")
    .setAttribute("style", "color:" + localStorage.getItem("text") + ";");
}

function tS2I(val) {
  if (val === "") "" === 0;
  let mins_secs = val.split(":");
  let mins = mins_secs[0];
  return (mins ? parseInt(mins) * 60 : 0) + parseInt(mins_secs[1]);
}

function flashy(name) {
  if (document.getElementById("timer" + name).style.color === "") {
    document.getElementById("timer" + name).style.color = "#ffffff";
    document.getElementById("timer" + name).style.background =
      localStorage.getItem("grad1") === null
        ? "#ff0000"
        : localStorage.getItem("grad1");
  } else {
    document.getElementById("timer" + name).style = "";
  }
}

function setIntervalX(callback, delay, repetitions) {
  let x = 0;
  let intervalID = window.setInterval(function () {
    callback();
    if (++x === repetitions) window.clearInterval(intervalID);
  }, delay);
}

function tI2S(val) {
  return Math.floor(val / 60) + ":" + (val % 60 < 10 ? "0" : "") + (val % 60);
}

function loadTime(val) {
  document.getElementById("timermain").value = document.getElementById(
    val + "box"
  ).value;
}

function pauseTimer(name) {
  clearInterval(intervals[name]);
  intervals[name] = null;
}

function imagechange() {
  if (localStorage.getItem("flagchange") === "") {
    if (
      removeNumber(
        document.getElementById("inp" + counter1).value.toLowerCase()
      ) === null ||
      removeNumber(
        document.getElementById("inp" + counter1).value.toLowerCase()
      ) === ""
    )
      return;
    incount.value = document.getElementById("inp" + counter1).value;
    document
      .getElementById("inp" + counter1)
      .setAttribute("style", "background-color:rgba(255,255,0,0.2);");
    if (counter1 != 1) {
      document
        .getElementById("inp" + (counter1 - 1))
        .setAttribute("style", "background-color:rgba(211,211,211,0.1);");
      document.getElementById("inp" + (counter1 - 1)).disabled = true;
    }
    counter1++;
    return;
  } else {
    let flagImage = document.querySelector("#flagarea > img");
    let flagInput = document.getElementById("inp" + counter1);
    let flagSelect = removeNumber(flagInput.value.toLowerCase());
    if (flagSelect === null || flagSelect === "") return;
    flagImage.src = "images/flags/" + flagSelect + ".svg";
    flagImage.onerror = function () {
      document.querySelector("#flagarea > img").src =
        "images/flags/united%20nations.svg";
      scell(flagInput);
    };
    incount.value = flagInput.value;
    flagInput.setAttribute(
      "style",
      "background-color:rgba(255,255,0,0.2);color: #000000;"
    );
    flagInput.disabled = true;
    if (counter1 != 1) {
      document
        .getElementById("inp" + (counter1 - 1))
        .setAttribute("style", "background-color:rgba(211,211,211,0.1);");
      document.getElementById("inp" + (counter1 - 1)).disabled = true;
      counter1++;
      return;
    }
    counter1++;
  }
}

function scell(val) {
  let xhr = new XMLHttpRequest();
  xhr.open(
    "GET",
    "https://en.wikipedia.org/w/api.php?action=query&origin=*&format=json&formatversion=2&generator=search&prop=pageimages&piprop=original&gsrsearch=" +
      encodeURI(val.value)
  );
  xhr.onreadystatechange = function () {
    if (xhr.readyState === XMLHttpRequest.DONE) {
      let status = xhr.status;
      if (
        status >= 200 &&
        status < 400 &&
        JSON.parse(xhr.responseText).hasOwnProperty("query")
      ) {
        let rsp = JSON.parse(xhr.responseText)["query"]["pages"];
        for (let i in rsp) {
          if (rsp[i].hasOwnProperty("original")) {
            document
              .getElementById("progflag")
              .setAttribute("src", rsp[i]["original"]["source"]);
            document.querySelector("#flagarea > img").alt = rsp[i]["title"];
            let opt = document.createElement("option");
            opt.value = val.value;
            document.getElementsByTagName("datalist")[0].append(opt);
            break;
          }
        }
      }
    }
  };
  xhr.send();
}

function removeNumber(s) {
  i = s.lastIndexOf(" ");
  if (isNaN(parseInt(s.substring(i + 1)))) {
    return s;
  } else {
    return s.substring(0, i);
  }
}

function countFilled() {
  let counter3 = 0;
  for (let i = 1; i < counter2; i++) {
    if (document.getElementById("inp" + i).value) counter3++;
  }
  if (counter2 - counter3 < 13) addspeakers(10);
}

function addspeakers(num) {
  for (i = 0; i < num; i++) {
    input = document
      .getElementById("sprow")
      .appendChild(document.createElement("input"));
    input.id = "inp" + counter2;
    input.setAttribute("list", "speakers");
    input.placeholder = "Speaker " + counter2;
    input.onchange = countFilled;
    counter2++;
  }
}

function resetlist() {
  document.querySelector("#flagarea > img").src =
    "images/flags/united%20nations.svg";
  counter1 = counter2 = 1;
  newlist();
  addspeakers(20);
}

function newlist() {
  document
    .getElementById("spscroll")
    .removeChild(document.getElementById("splist"));
  document
    .getElementById("spscroll")
    .appendChild(document.createElement("table"))
    .setAttribute("id", "splist");
  document
    .getElementById("splist")
    .appendChild(document.createElement("tbody"));
  document
    .getElementsByTagName("tbody")[0]
    .appendChild(document.createElement("tr"));
  document
    .getElementsByTagName("tr")[0]
    .appendChild(document.createElement("td"))
    .setAttribute("id", "sprow");
  document
    .getElementById("spscroll")
    .insertBefore(
      document.getElementById("splist"),
      document.getElementById("spscroll").childNodes[0]
    );
}

function startTimer(name) {
  let timer = document.getElementById("timer" + name);
  if (intervals[name] || timer.value === 0) return;
  intervals[name] = setInterval(function () {
    let rem = tS2I(timer.value);
    if (isNaN(rem) === true) {
      timer.value = "";
      return;
    }
    if (rem <= 0) {
      setIntervalX(
        function () {
          flashy(name);
        },
        500,
        4
      );
      console.log(169, localStorage.getItem("gavel"));
      if (localStorage.getItem("gavel") === "x") {
        new Audio("links/audio.mp3").play();
      }
      clearInterval(intervals[name]);
      intervals[name] = null;
      return;
    }
    rem--;
    timer.value = tI2S(rem);
  }, 1000);
}

